INSERT INTO public.hl7_table_definitions VALUES (28786, '0906', 'A', 'ASAP - As soon as possible, next highest priority after stat');
INSERT INTO public.hl7_table_definitions VALUES (28787, '0906', 'CR', 'Callback results - filler should contact the placer as soon as results are available, even for preliminary results');
INSERT INTO public.hl7_table_definitions VALUES (28788, '0906', 'CS', 'Callback for scheduling - Filler should contact the placer (or target) to schedule the service.');
INSERT INTO public.hl7_table_definitions VALUES (28789, '0906', 'CSP', 'Callback placer for scheduling - filler should contact the placer to schedule the service');
INSERT INTO public.hl7_table_definitions VALUES (28790, '0906', 'CSR', 'Contact recipient for scheduling - Filler should contact the service recipient (target) to schedule the service');
INSERT INTO public.hl7_table_definitions VALUES (28791, '0906', 'EL', 'Elective - Beneficial to the patient but not essential for survival.');
INSERT INTO public.hl7_table_definitions VALUES (28792, '0906', 'EM', 'Emergency - An unforeseen combination of circumstances or the resulting state that calls for immediate action');
INSERT INTO public.hl7_table_definitions VALUES (28793, '0906', 'P', 'Preop - Used to indicate that a service is to be performed prior to a scheduled surgery.  When ordering a service and using the pre-op priority, a check is done to see the amount of time that must be allowed for performance of the service.  When the order');
INSERT INTO public.hl7_table_definitions VALUES (28794, '0906', 'PRN', 'As needed - An "as needed" order should be accompanied by a description of what constitutes a need.  This description is represented by an observation service predicate as a precondition.');
INSERT INTO public.hl7_table_definitions VALUES (28795, '0906', 'R', 'Routine - Routine service, do at usual work hours');
INSERT INTO public.hl7_table_definitions VALUES (28796, '0906', 'RR', 'Rush reporting - A report should be prepared and sent as quickly as possible');
INSERT INTO public.hl7_table_definitions VALUES (28797, '0906', 'S', 'Stat - With highest priority (e.g. emergency).');
INSERT INTO public.hl7_table_definitions VALUES (28798, '0906', 'T', 'Timing critical - It is critical to come as close as possible to the requested time (e.g. for a through antimicrobial level).');
INSERT INTO public.hl7_table_definitions VALUES (28799, '0906', 'UD', 'Use as directed - Drug is to be used as directed by the prescriber.');
INSERT INTO public.hl7_table_definitions VALUES (28800, '0906', 'UR', 'Urgent - Calls for prompt action');
INSERT INTO public.hl7_table_definitions VALUES (28801, '0907', 'B', 'Business - Since the service class can represent knowledge structures that may be considered a trade or business secret, there is sometimes (though rarely) the need to flag those items as of business level confidentiality.  However, no patient related inf');
INSERT INTO public.hl7_table_definitions VALUES (28802, '0907', 'D', 'Clinician - Only clinicians may see this item, billing and administration persons can not access this item without special permission.');
INSERT INTO public.hl7_table_definitions VALUES (28803, '0907', 'I', 'Individual - Access only to individual persons who are mentioned explicitly as actors of this service and whose actor type warrants that access (cf. to actor typed code).');
INSERT INTO public.hl7_table_definitions VALUES (28804, '0907', 'L', 'Low - No patient record item can be of low confidentiality.  However, some service objects are not patient related and therefore may have low confidentiality.');
INSERT INTO public.hl7_table_definitions VALUES (28805, '0907', 'N', 'Normal - Normal confidentiality rules (according to good health care practice) apply, that is, only authorized individuals with a legitimate medical or business need may access this item.');
INSERT INTO public.hl7_table_definitions VALUES (28806, '0907', 'R', 'Restricted - Restricted access, e.g. only to providers having a current care relationship to the patient.');
INSERT INTO public.hl7_table_definitions VALUES (28807, '0907', 'V', 'Very restricted - Very restricted access as declared by the Privacy Officer of the record holder.');
INSERT INTO public.hl7_table_definitions VALUES (28808, '0907', 'ETH', 'Substance abuse related - Alcohol/drug-abuse related item');
INSERT INTO public.hl7_table_definitions VALUES (28809, '0907', 'HIV', 'HIV Related - HIV and AIDS related item');
INSERT INTO public.hl7_table_definitions VALUES (28810, '0907', 'PSY', 'Psychiatry related - Psychiatry related item');
INSERT INTO public.hl7_table_definitions VALUES (28811, '0907', 'SDV', 'Sexual and domestic violence related - Sexual assault / domestic violence related item');
INSERT INTO public.hl7_table_definitions VALUES (28812, '0907', 'C', 'Celebrity - Celebrities are people of public interest (VIP) including employees, whose information require special protection.');
INSERT INTO public.hl7_table_definitions VALUES (28813, '0907', 'S', 'Sensitive - Information for which the patient seeks heightened confidentiality.  Sensitive information is not to be shared with family members.  Information reported by the patient about family members is sensitive by default.  Flag can be set or cleared');
INSERT INTO public.hl7_table_definitions VALUES (28814, '0907', 'T', 'Taboo - Information not to be disclosed or discussed with patient except through physician assigned to patient in this case.  This is usually a temporary constraint only; example use is a new fatal diagnosis or finding, such as malignancy or HIV.');
INSERT INTO public.hl7_table_definitions VALUES (28815, '0909', 'STBD', 'Share To Be Determined -<p>Category to be determined');
INSERT INTO public.hl7_table_definitions VALUES (28816, '0909', 'SIMM', 'Share Immediately -<p>Share result with patient immediately');
INSERT INTO public.hl7_table_definitions VALUES (28817, '0909', 'SWNL', 'Share Within Normal Limits -<p>Share result in reference/therapeutic range with patient immediately<p>Share result out of reference/therapeutic ranges with patient after 1 or more business day as agreed to by the systems in play.');
INSERT INTO public.hl7_table_definitions VALUES (28818, '0909', 'SID', 'Share In1 Day -<p>Share result regardless of reference/therapeutic range after 1 or more business day as agreed to by the systems in play.');
INSERT INTO public.hl7_table_definitions VALUES (28819, '0909', 'SIDC', 'Share in 1 Day Conditionally -<p>Share result in reference ranges/therapeutic with patient after 1 or more business day as agreed to by the systems in play.<p>Withhold result out of reference/therapeutic range until physician release');
INSERT INTO public.hl7_table_definitions VALUES (28820, '0909', 'SWTH', 'Share Withhold -<p>Withhold result regardless of reference/therapeutic ranges');
